let layers = ["yen", "W", "EU", "pound", "rupee", "dollar"];
let currentLayer = 0;

document.getElementById("currency").addEventListener("click", function() {
  // Hide the current layer
  document.getElementById(layers[currentLayer]).style.display = "none";

  // Increment the current layer
  currentLayer++;

  // If we've gone past the end of the array, start over
    if (currentLayer >= layers.length) {
      currentLayer = 0;
    }

  // Show the new current layer
  document.getElementById(layers[currentLayer]).style.display = "block";
});
</script>
